import React from "react";
import AsDriver from "../SignIn/AsDriver";
import "../SignIn/"

function Login() {
  return (
    <section id="login">
      <h2>Log in</h2>
      <div className="body-in">
        <form>
          <div>
            <input type="text" name="username" />
          </div>
          <div>
            <input type="password" name="password0" />
          </div>
          <button type="submit">Log in</button>
        </form>
      </div>
    </section>
  );
}

export default Login;
